        backgroundColor: 'grey', 
        display: 'flex', 
        alignItems: 'center', 
        justifyContent: 'center' 
      }}>
        404 Not Found
        {/* Link back to the root page */}
        <Link to="/"> Home form link </Link>
      </div>
    </div>
  );
};

export default ErrorPage
